                            <Route exact="true" path="/">
                                <div>kkkk</div>
                            </Route>
                            <Route path="/about">
                                <div>kkkk</div>
                            </Route>
                            <Route path="/company">
                                
                            </Route>
                            <Route path="/admin_account">
                                
                            </Route>
                    </Switch>
                    
                </div>
            </Router>
        );
    }
}


export default Layout;
